INSERT INTO `lugares` (`id`, `imagen`, `nombre`, `mas`) VALUES
(7, , 'Estancia Jesuítica y Museo del Virrey Liniers', 'El Museo Nacional Estancia Jesuítica de Alta Gracia \r\ny Casa del Virrey Liniers es un museo de la ciudad de Alta Gracia,\r\nprovincia de Córdoba, que se encuentra ubicado en lo que fuera\r\nla residencia jesuítica del siglo XVII, que formaba parte de la \r\nEstancia de Alta Gracia. En el año 2000 fue declarado Patrimonio\r\nde la Humanidad por la UNESCO.\r\nEl museo cuenta con 17 salas de exposición permanente que han sido\r\nambientadas acorde a los modos de vida de cordobeses y especialmente\r\nde los serranos durante los siglos XVII, XVIII y XIX. Su patrimonio \r\nestá compuesto por objetos de gran importancia que evocan la vida cotidiana\r\ny las formas de trabajo en la antigua estancia.');
INSERT INTO `lugares` (`id`, `imagen`, `nombre`, `mas`) VALUES
(8, , 'La Gruta', 'A solo tres kilómetros del centro de la ciudad emerge el Santuario de la Virgen de Lourdes, un lugar rodeado de naturaleza que invita a la paz y a la oración.\r\n\r\nFue construido en 1916 como réplica del existente en Francia y el 11 de febrero, en el Día de la Virgen de Lourdes, miles de fieles llegan para renovar su fe.\r\n\r\nDesde septiembre de 2011 se registra un fenómeno en la hornacina del retablo que capta la atención de miles de fieles, que llegan cada día a contemplar “La Imagen”.');
INSERT INTO `lugares` (`id`, `imagen`, `nombre`, `mas`) VALUES
(9, , 'El Tajamar', 'El Tajamar es una más de las construcciones del legado jesuita que se encuentra ubicado en la Localidad de Alta Gracia, en el Valle de Paravachasca, a 36 km. de la Ciudad de Córdoba Capital, accediendo por la Ruta Provincial Nº 5.\r\nHoy en día es un lugar de encuentro familiar y esparcimiento, un lugar único e imperdible de la ciudad de Alta Gracia.\r\n\r\n\r\n');
INSERT INTO `lugares` (`id`, `imagen`, `nombre`, `mas`) VALUES
(10, , 'Sierras Hotel y Casino', 'El Sierras Hotel fue el primer Hotel Casino de la República Argentina, que habiendo iniciado sus actividades en el año 1908, rápidamente se convirtió en un polo de atracción para el turismo y el esparcimiento, como así también en destacado referente nacional e internacional de actividades culturales, científicas y sociales.\r\n');
INSERT INTO `lugares` (`id`, `imagen`, `nombre`, `mas`) VALUES
(11, , 'Arroyo Chicamtoltina', 'Bajo denominación comechingona, que en español se significa “Agua Fría” – el arroyo Chicamtoltina cruza la ciudad de Alta Gracia de noroeste a sudeste con aguas trasparentes y tranquilas, llamando al disfrute de los sonidos naturales bajo la sombra de coposos árboles.');
INSERT INTO `lugares` (`id`, `imagen`, `nombre`, `mas`) VALUES
(12, , 'Museo del Che Guevara', 'El Museo muestra el honroso tributo de la tierra que lo vio crecer, a su memoria, a su vida digna y a su ejemplo… el ejemplo para las nuevas generaciones, que encuentran en ésta, su casa, el eco de sus pasos. Aquí se perpetúa un sentido homenaje, al niño, al joven, al amigo, a la figura universal: “El Che”.\r\n\r\nEste museo abre sus puertas el día 14 de julio de 2001. Desde aquí queremos mostrar qué fue lo que Ernesto encontró y vivió en este lugar que contribuyó a crear la personalidad y el carácter de quien se proyectaría sobre la historia como: “El Che”.');
INSERT INTO `lugares` (`id`, `imagen`, `nombre`, `mas`) VALUES
(13, , 'Primer paredón ', 'Teniendo su origen fuera de la Alta Gracia, el río los Paredones pasaba por la ciudad y cambió su nombre a la actual. Cerca del Parque García Lorca, donde es bueno para nadar, ofrece impresionantes paisajes de la naturaleza. Su agua limpia, permite a los campistas refrescarse y que los niños se diviertan con seguridad.');
INSERT INTO `lugares` (`id`, `imagen`, `nombre`, `mas`) VALUES
(14, , 'Parque Garcia Lorca', 'El Parque García Lorca fue creado en el año 1984 con la idea de brindar a la población un lugar de recreación y un ámbito gratuito que proporcionara la contención necesaria a los deportistas de todos los niveles económico y para esto se delegó en las manos de Juan Nicolás “Chungui” Caviglia -quien era por esos momentos el Director de Deportes y Recreación de la Municipalidad– su creación. “Lo armó piedra a piedra” destacaron los familiares hace unos años atrás a este medio, y eso se puede comprobar en cada rincón del parque. En el año 2002 estuvo a punto de ser rematado para convertirse en un loteo urbano y fue salvado por los vecinos y familiares de Caviglia quienes realizaron un abrazo simbólico al lugar.');
INSERT INTO `lugares` (`id`, `imagen`, `nombre`, `mas`) VALUES
(15, , 'Laguna Azul', 'Un balneario de 500 metros de largo constituye uno de los atractivos turísticos más privilegiados de la localidad de La Calera. Un encantador espejo de agua transparente que vierte de lo que anteriormente fue una cantera, es un espacio propicio para practicar deportes náuticos y actividades recreativas. Actualmente el lugar es de propiedad privada.');

